import React, { useState, useMemo } from 'react';

const MemoExample = () => {
  const [count, setCount] = useState(0);

  const doubled = useMemo(() => {
    return count * 2;
  }, [count]);

  return (
    <div><fieldset>
      <p>Count: {count}</p>
      <p>Doubled: {doubled}</p>
      <button onClick={() => setCount(count + 1)}>Increment</button>
      </fieldset>
    </div>
  );
};

export default MemoExample;
